import React from "react";
import profilePic from "../../assets/images/profile.jpg";
import styles from "../../styles/profile.module.css";
import mockUsers from "../../data/mockUsers";

const ProfilePage = () => {
  const user = mockUsers.find((user) => user.id === 0); // Replace this with actual data fetching

  return (
    <div className={styles.profilePage}>
      <div className={styles.profileContainer}>
        <img src={profilePic} alt={user.fullName} className={styles.profilePic} />
        <div className={styles.userInfo}>
          <h1>{user.fullName}</h1>
          <p>{user.email}</p>
        </div>
      </div>
      <div className={styles.barInfo}>
        <h2>Bar: {user.bar}</h2>
        <p><strong>Role:</strong> {user.role}</p>
        <p><strong>Menus Created:</strong> {user.menusCreated || 5}</p> {/* Mock data */}
        <p><strong>Cocktails in Database:</strong> {user.cocktailsInDb || 15}</p> {/* Mock data */}
        <p><strong>Last Login:</strong> {user.lastLogin || '2024-10-01'}</p> {/* Mock data */}
      </div>
    </div>
  );
};

export default ProfilePage;
